description:
Storyline: All twelve episodes from the first season of the American horror drama that follows the events that befall a family when they unwittingly relocate to a haunted house. Psychiatrist Dr. Ben Harmon (Dylan McDermott), his wife Vivien (Connie Britton) and teenage daughter Violet (Taissa Farmiga), move from Boston to Los Angeles to start again, after Vivien gives birth to a stillborn baby and Ben has an affair with Hayden (Kate Mara), one of his students. But when Hayden subsequently visits L.A. in the hope of rekindling her lost relationship, she sets in motion a chain of events that will have terrifying consequences for all concerned, as over the coming months the Harmon household's ghostly residents set in play their secret, murderous agenda. The episodes are: 'Pilot', 'Home Invasion', 'Murder House', 'Halloween: Part 1', 'Halloween: Part 2', 'Piggy Piggy', 'Open House', 'Rubber Man', 'Spooky Little Girl', 'Smoldering Children', 'Birth' and 'Afterbirth'.


Cast: Starring: Frances Conroy, Connie Britton, Jessica Lange, Zachary Quinto, Dylan McDermott
Director: Ryan Murphy


